import React, {Component} from 'react';
import './App.css';
import Clarifai from 'clarifai';
import FaceRecognition from './Components/FaceRecognition/FaceRecognition'
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import Rank from './Components/Rank/Rank';
import AppParticles from './Components/Particles/Particles';
//import { useEffect, useMemo, useState } from "react";
//import Particles, { initParticlesEngine } from "@tsparticles/react";
//import { loadSlim } from "@tsparticles/slim";

const app = new Clarifai.App({
  apiKey: 'da25080a0f594fbfb117ffb83bcaaf1b'
 });

class App extends Component {

  constructor(){
    super();
    this.state={
      input: '',
      imageUrl: '',
      facebox: {}
    }
  }

  calculateFaceLocation =(data)=>{
    const clarifaiFace= data.outputs[0].data.regions[0].region_info.bounding_box
    const image= document.getElementById('inputImage')
  }

  onInputChange= (event)=>{
    this.setState({input: event.target.value})
  }

  onButtonSubmit= ()=>{
    this.setState({imageUrl: this.state.input})
    app.models.predict(Clarifai.FACE_DETECT_MODEL, this.state.input).then(response=>this.calculateFaceLocation(response)
    .catch(err=>console.log(err))
    ); 
  }

   render(){
      return (
        <div className="App">
          <AppParticles className='particles'
            //id="tsparticles"
            //particlesLoaded={particlesLoaded}
            //options={particleOptions}
          />

          <Navigation/>
          <Logo />
          <ImageLinkForm 
          onInputChange={this.onInputChange} 
          onButtonSubmit={this.onButtonSubmit}/>
          <Rank />
          <FaceRecognition imageUrl={this.state.imageUrl}/>
        </div>
      );
    }


  };


export default App;
